import { Close } from "@mui/icons-material";
import {
  Button,
  Card,
  Grid,
  IconButton,
  Modal,
  TextField,
  Typography,
} from "@mui/material";
import React, { useState } from "react";

export default function NewGroupModal({ show, toggle }) {
  const [groupName, setGroupName] = useState("");
  const [groupMin, setGroupMin] = useState("");
  const [groupCount, setGroupCount] = useState("");
  return (
    <Modal open={show} onClose={toggle} sx={modalStyle}>
      <Card sx={cardStyle}>
        <IconButton
          color="error"
          size="large"
          sx={{ position: "absolute", top: 5, right: 5 }}
          onClick={toggle}
        >
          <Close />
        </IconButton>
        <Typography variant="h4" align="center" mb={2}>
          Create New Group
        </Typography>
        <Grid container columnGap={3} rowGap={2} justifyContent="center">
          <Grid item>
            <TextField
              label="Group Name"
              value={groupName}
              onChange={(e) => setGroupName(e.target.value)}
            />
          </Grid>
          <Grid item>
            <TextField
              label="Lowest Number"
              value={groupMin}
              onChange={(e) => setGroupMin(e.target.value)}
            />
          </Grid>
          <Grid item>
            <TextField
              label="Group Count"
              value={groupCount}
              onChange={(e) => setGroupCount(e.target.value)}
            />
          </Grid>
          <Grid item xs={12} align="center">
            <Button color="success">Create Group</Button>
          </Grid>
        </Grid>
      </Card>
    </Modal>
  );
}

const modalStyle = {
    width: "1000px",
    maxWidth: "90vw",
    m: "8rem auto 0 auto",
  },
  cardStyle = {
    p: 2,
  };
